const myImage = new Image();
myImage.src = 'data:image/png;base64,';
myImage.addEventListener("load", function () {
  const canvas = document.getElementById("canvas1");

  const ctx = canvas.getContext("2d");

  canvas.width = 800;
  canvas.height = 533;

  ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
  const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
  ctx.clearRect(0,0,canvas.width, canvas.height); 

  let particlesArray = [];
  const numberOfPArticles = 5000;

  // hold brightness values of each image, to be compareable
  let mappedImage = [];
  for (let y = 0; y < canvas.height; y++) {
    let row = [];
    for (let x = 0; x < canvas.width; x++) {
      const red = pixels.data[y * 4 * pixels.width + x * 4];
      const green = pixels.data[y * 4 * pixels.width + x * 4 + 1];
      const blue = pixels.data[y * 4 * pixels.width + x * 4 + 2];
      const brightness = caclulateRelativeBrightness(red, green, blue);
    
       const cell = [
         cellBrightness = brightness,
       ];
      row.push(cell);
    }
    mappedImage.push(row);
  }

  console.log(mappedImage);

  function caclulateRelativeBrightness(red, green, blue) {
    return (
      Math.sqrt(
        red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114
      ) / 100
    );
  }

  class Particle {
    constructor() {
      //define the effect you want to go for
      this.x = Math.random() * canvas.width;
      this.y = 0;
      this.speed = 0;
      this.velocity = Math.random() * 0.5; //fall fast over black and slow over light areas
      this.size = Math.random() * 1.5 + 1;
      //round down to integers
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
    }
    update() {
      //round down to integers
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
      this.speed = mappedImage[this.position1][this.position2][0];
      //dark particles move fast, light particles move very slow (2.5 = max), randomize it with velocity
      let movement = 2.5 - this.speed + this.velocity;

      this.y += movement;
      if (this.y >= canvas.height) {
        this.y = 0;
        this.x == Math.random() * canvas.width;
      }
    }
    draw() {
      ctx.beginPath();
      ctx.fillStyle = "white";
      ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
      ctx.fill();
    }
  }
  //fill it with particles and run this numberOfParticles times
  function init() {
    for (let i = 0; i < numberOfPArticles; i++) {
      particlesArray.push(new Particle());
    }
  }
  //fill the array
  init();
  //cycle throw all numberOfPArticles for each frame of animation, recalc their position with update method
  //And draw them on new coordinates with draw method
  function animate() {
    //ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.05;
    ctx.fillStyle = "rgb(0,0,0)";
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.2;
    for (let i = 0; i < particlesArray.length; i++) {
      particlesArray[i].update();
      //this gives the speed of the rain which draws the image
      ctx.globalAlpha = particlesArray[i].speed * 0.2;
      particlesArray[i].draw();
    }
    requestAnimationFrame(animate); //recall the animate function = recursion
  }
  animate();
});
